有时候我们需要为方便调用来导出一些公共 API, 这样就可以使用 pub use 关键字 pub use 作用是 重新导出 , 创建了一个与内部私有结构不同的对外公共结构 假设我们有这么一个文件 src/lib.rs //! # Learn Rust
//!
//! `learn_rust` 是我学习 Rust 时的一个测试项目, 方便进行测试 pub mod kinds { /// The primary colors according to the RYB color model pub enum PrimaryColor { Red, Yellow, Blue, } /// The secondary colors according to the RYB color model pub enum SecondaryColor { Orange, Green, Purple, }
} pub mod utils { use crate::kinds::*; /// Combines two primary colors in equal amounts to create /// a secondary color pub fn mix(color1: PrimaryColor, color2: PrimaryColor) -> SecondaryColor { SecondaryColor::Green }
} 在文档里表现出来是这样的 test doc 不是很直观, 也不清楚每个模块里的的东西 如果我们在文件里加上这几行 // src/lib.rs pub use self::kinds::PrimaryColor;
pub use self::kinds::SecondaryColor;
pub use self::utils::mix; // ... 再看一眼文档, 会出现一个 Re-exports 栏目, 里面摆上了我们重新导出的内容, 就很直观了 after pub use 在使用时, 我们也只需要 <projName>::<itemName> 即可, itemName 是你导出的内容的名字

