>(Unique<T>, A); 在解引用时, 对于 *b 这个操作, 在 Box 类型上会变成 *(b.deref()) 因为 deref 操作只会返回值的引用, 所以还需要一个普通的解引用才能完成解引用操作 Deref Coercion 如果 T 实现了 Deref, Deref Coercion 会把 T 的引用 转变为 T 经过 Deref 操作后生成的引用 fn main() { let p = Box::new(String::from("Kands")); hello(&p);
