Rc<T> 是引用计数智能指针 有时一个值会有多个所有者, 如 图里面的某个节点同时属于多个边 如果需要在 Heap 上分配数据, 并且这个数据将被程序的多个部分读取(只读), 但是不知道哪部分会先用完数据, 则可以使用 Rc<T> 但是要注意, Rc<T> 是 仅适用于单线程的 Rc::clone(&a) 增加引用计数 Rc::strong_count(&a) 获得引用计数 还有 Rc::weak_count() 使用例子: use std::rc::Rc; enum List<T> { Cons(T, Rc<List<T>>), Nil,
} use List::*; fn main() { // Rc(5 -> 10 -> nil) let a = Rc::new(Cons(5, Rc::new(Cons(10, Rc::new(Nil))))); println!("{}", Rc::strong_count(&a)); // => 1 // 3 -> a |=> 3 -> 5 -> 10 -> nil let b = Cons(3, Rc::clone(&a)); println!("{}", Rc::strong_count(&a)); // => 2 // 4 -> a |=> 4 -> 5 -> 10 -> nil let c = Cons(4, Rc::clone(&a)); println!("{}", Rc::strong_count(&a)); // => 3
} Rc::clone 相较于 clone(), 不会执行数据的深度拷贝操作, 只会增加引用计数, 相对较快 Rc<T> 实际上是使用不可变引用使得数据可以共享

