Rc<T> 使用的是不可变引用, 如果我们需要对共享的数据进行修改 RefCell 代表了其持有数据的唯一所有权, 而且只能在单线程使用 Box<T> Rc<T> RefCell<T> 同一数据的所有者 一个 多个 一个 可变性, 借用检查 可变, 不可变借用 (编译时检查) 不可变借用 (编译时检查) 可变, 不可变借用 (运行时检查) 例子如下 pub trait Messager { fn send(&self, msg: &str);
} pub struct LimitTracker<'a, T: 'a + Messager> { messager: &'a T, value: usize, max: usize,
} impl<'a, T> LimitTracker<'a, T>
where T: Messager,
{ pub fn new(messager: &T, max: usize) -> LimitTracker<T> { LimitTracker { messager, value: 0, max, } } pub fn set_value(&mut self, value: usize) { self.value = value; let percentage_of_max = self.value as f64 / self.max as f64; if percentage_of_max >= 1.0 { self.messager.send("Error: You're over your quota!"); } else if percentage_of_max >= 0.9 { self.messager .send("Urgent warning: You've used up over 90% of your quota!"); } else if percentage_of_max >= 0.75 { self.messager .send("Warning: You've used up over 75% of your quota!"); } }
} #[cfg(test)]
mod tests { use super::*; use std::cell::RefCell; struct MockMessager { sent_messages: RefCell<Vec<String>>, } impl MockMessager { fn new() -> MockMessager { MockMessager { sent_messages: RefCell::new(vec![]), } } } impl Messager for MockMessager { fn send(&self, msg: &str) { self.sent_messages.borrow_mut().push(String::from(msg)); } } #[test] fn it_sends_an_over_75_persent_warning_message() { let mock_messager = MockMessager::new(); let mut limit_tracker = LimitTracker::new(&mock_messager, 100); limit_tracker.set_value(100); assert_eq!(mock_messager.sent_messages.borrow().len(), 1); }
} RefCell 会记录存在多少个活跃的 Ref<T> 和 RefMut<T> 智能指针, 这样就保证了借用规则 我们还可以将 RefCell 和 Rc 结合起来使用 use std::{cell::RefCell, rc::Rc}; #[derive(Debug)]
enum List<T> { Cons(Rc<RefCell<T>>, Rc<List<T>>), Nil,
} use List::*; fn main() { // * -> 5 -> * let value = Rc::new(RefCell::new(5)); // 5 -> nil let a = Rc::new(Cons(Rc::clone(&value), Rc::new(Nil))); // 6 -> a |=> 6 -> 5 -> nil let b = Cons(Rc::new(RefCell::new(6)), Rc::clone(&a)); // 10 -> a |=> 10 -> 5 -> nil let c = Cons(Rc::new(RefCell::new(10)), Rc::clone(&a)); println!("a = {:?}", a); println!("b = {:?}", b); println!("c = {:?}", c); /* * a = Cons(RefCell { value: 5 }, Nil) * b = Cons(RefCell { value: 6 }, Cons(RefCell { value: 5 }, Nil)) * c = Cons(RefCell { value: 10 }, Cons(RefCell { value: 5 }, Nil)) */ *value.borrow_mut() += 10; println!("a = {:?}", a); println!("b = {:?}", b); println!("c = {:?}", c); /* * a = Cons(RefCell { value: 15 }, Nil) * b = Cons(RefCell { value: 6 }, Cons(RefCell { value: 15 }, Nil)) * c = Cons(RefCell { value: 10 }, Cons(RefCell { value: 15 }, Nil)) */
} 除此之外, 我们还可以使用 Cell<T> 使用复制数据来访问数据, Mutex<T> 实现了跨线程下的内部可变性

