Rust 也是可以发生内存泄漏的, 即使用 Rc 和 RefCell 有可能实现循环引用, 从而导致内存泄漏 use std::{cell::RefCell, rc::Rc}; #[derive(Debug)]
enum List<T> { Cons(T, RefCell<Rc<List<T>>>), Nil,
} impl<T> List<T> { fn tail(&self) -> Option<&RefCell<Rc<List<T>>>> { match self { Cons(_, item) => Some(item), Nil => None, } }
} use List::*; fn main() { let a = Rc::new(Cons(5, RefCell::new(Rc::new(Nil)))); println!("a init rc count = {}", Rc::strong_count(&a)); println!("a next item = {:?}", a.tail()); let b = Rc::new(Cons(10, RefCell::new(Rc::clone(&a)))); println!("a rc count = {}", Rc::strong_count(&a)); println!("b init rc count = {}", Rc::strong_count(&b)); println!("b next item = {:?}", b.tail()); if let Some(link) = a.tail() { *link.borrow_mut() = Rc::clone(&b); } println!("b rc count = {}", Rc::strong_count(&b)); println!("a rc count = {}", Rc::strong_count(&a)); // a -> 5 // ^ | // | v // 10 <- b // println!("a next item = {:?}", a.tail()); // thread 'main' has overflowed its stack // error: process didn't exit successfully: // `target\debug\sp.exe` (exit code: 0xc00000fd, STATUS_STACK_OVERFLOW)
} 上面的例子里, a 和 b 就形成了循环引用, 导致了内存泄漏 Weak<T> 防止循环引用可以使用 Weak<T> Rc::clone() 为 Rc<T> 实例的 strong_count 加一, Rc<T> 的实例只有在 strong_count = 0 的情况下被清理 Rc<T> 实例通过调用 Rc::downgrade 方法可以创建值的 Weak Reference 返回 Weak<T> 调用 Rc::downgrade 会为 weak_count 加一 Rc<T> 使用 weak_count 来追踪还有多少 Weak<T> 但是 weak_count 不影响 Rc<T> 是否被清理, 而且弱引用不持有所有权, 强引用计数为 0 时, 将自动断开 在使用 Weak<T> 前需要保证指向的值存在, 使用 upgrade() 方法可以返回 Option<Rc<T>> use std::cell::RefCell;
use std::rc::{Rc, Weak}; #[derive(Debug)]
struct Node<T> { value: T, parent: RefCell<Weak<Node<T>>>, children: RefCell<Vec<Rc<Node<T>>>>,
} fn main() { let leaf = Rc::new(Node { value: 3, parent: RefCell::new(Weak::new()), children: RefCell::new(vec![]), }); println!( "leaf strong = {}, weak = {}", Rc::strong_count(&leaf), Rc::weak_count(&leaf) ); { let branch = Rc::new(Node { value: 5, parent: RefCell::new(Weak::new()), children: RefCell::new(vec![Rc::clone(&leaf)]), }); *leaf.parent.borrow_mut() = Rc::downgrade(&branch); println!( "branch strong = {}, weak = {}", Rc::strong_count(&branch), Rc::weak_count(&branch) ); println!( "leaf strong = {}, weak = {}", Rc::strong_count(&leaf), Rc::weak_count(&leaf) ); } println!("leaf parent = {:?}", leaf.parent.borrow().upgrade()); println!( "leaf strong = {}, weak = {}", Rc::strong_count(&leaf), Rc::weak_count(&leaf) );
} /*
leaf strong = 1, weak = 0
branch strong = 1, weak = 1
leaf strong = 2, weak = 0
leaf parent = None
leaf strong = 1, weak = 0
*/ 好, 今天到此为止, 之后几天复习期末, 就摸了！

