Channel 包含发送端和接收端，发送端发送数据，接收端检查和接收数据 如果发送端或接收端任意一端被 "丢弃" 了，那么 channel 就关闭了 Rust 中使用 mpsc::channel 来创建 channel mpsc: multiple producer, single consumer 即多个发送端，一个接收端 发送端使用 send() 发送消息，接收端使用 recv() 接收消息 use std::{sync::mpsc, thread}; fn main() { let (tx, rx) = mpsc::channel(); thread::spawn(move || { let val = String::from("hello world"); tx.send(val).unwrap(); }); let res = rx.recv().unwrap(); println!("received: {}", res);
} 输出为 received: hello world 在这个简单例子里，我们使用 channel 实现了子线程和主线程之间的通信 我们 send 数据的时候，实际上是完成了一次所有权转移， 所以在 send 之后，无法使用 send 了的变量 tx.send(val).unwrap();
println!("val is {}", val); // error! 这就是个典型错误 我们还可以通过这个例子来看到接收端等待发送的例子 use std::sync::mpsc;
use std::thread;
use std::time::Duration; fn main() { let (tx, rx) = mpsc::channel(); let handle_t = thread::spawn(move || { let vals = vec![ String::from("hi"), String::from("from"), String::from("the"), String::from("thread"), ]; for val in vals { tx.send(val).unwrap(); thread::sleep(Duration::from_nanos(700)); } }); let handle_r = thread::spawn(move || { for rec in rx { println!("got: {}", rec); } }); for i in 1..=5 { println!("main: {}", i); thread::sleep(Duration::from_nanos(900)); } handle_t.join().unwrap(); handle_r.join().unwrap();
} 对应输出 main: 1
got: hi
main: 2
main: 3
got: from
main: 4
got: the
main: 5
got: thread 我们可以有多个发送者，使用 mpsc::Sender::clone() 来实现生成其他发送者 use std::sync::mpsc;
use std::thread;
use std::time::Duration; fn main() { let (tx1, rx) = mpsc::channel(); let tx2 = mpsc::Sender::clone(&tx1); let handle_t1 = thread::spawn(move || { let vals = vec![ String::from("hi"), String::from("from"), String::from("the"), String::from("thread"), ]; for val in vals { tx1.send(format!("1: {}", val)).unwrap(); thread::sleep(Duration::from_nanos(700)); } }); let handle_t2 = thread::spawn(move || { let vals = vec![ String::from("hi"), String::from("from"), String::from("the"), String::from("thread"), ]; for val in vals { tx2.send(format!("2: {}", val)).unwrap(); thread::sleep(Duration::from_nanos(700)); } }); let handle_r = thread::spawn(move || { for rec in rx { println!("got: {}", rec); } }); for i in 1..=5 { println!("main: {}", i); thread::sleep(Duration::from_nanos(2000)); } handle_t1.join().unwrap(); handle_t2.join().unwrap(); handle_r.join().unwrap();
} 对应输出如下 main: 1
got: 1: hi
got: 2: hi
got: 1: from
main: 2
got: 2: from
got: 1: the
main: 3
got: 2: the
