宏也是 Rust 的一大特色 the functionality and syntax of Rust can be extended with custom definitions called macros 宏在 Rust 中可以用在如下场景 [4] 宏作为表达式或语句 模式 (patterns) 类型 (types) item，包括 关联 item macro_rules 的 transcribers 外部语句块 下面是官方给出的例子 // Used as an expression.
let x = vec![1,2,3]; // Used as a statement.
println!("Hello!"); // Used in a pattern.
macro_rules! pat { ($i:ident) => (Some($i))
} if let pat!(x) = Some(1) { assert_eq!(x, 1);
} // Used in a type.
macro_rules! Tuple { { $A:ty, $B:ty } => { ($A, $B) };
} type N2 = Tuple!(i32, i32); // Used as an item.
use std::cell::RefCell;
thread_local!(static FOO: RefCell<u32> = RefCell::new(1)); // Used as an associated item.
macro_rules! const_maker { ($t:ty, $v:tt) => { const CONST: $t = $v; };
}
trait T { const_maker!{i32, 7}
} // Macro calls within macros.
macro_rules! example { () => { println!("Macro call in a macro!") };
}
// Outer macro `example` is expanded, then inner macro `println` is expanded.
example!(); 而过程宏 [5] 可以分为 衍生 (derive) 宏 ， 属性宏 ， 函数宏 ，分别用在 #[derive(xxx)]，自定义属性，以及作为函数调用

