这里我直接用例子来实践，一般，需要包含 syn , 和 quote 这两个包 组织项目 项目目录结构如下 $ tree -L 1 .
.
├── Cargo.toml
├── hello_macro
│ ├── Cargo.toml
│ └── src
└── proc_test ├── Cargo.toml └── src 即，我们需要创建一个工作空间，包含 proc_test 和 hello_macro 两个包 [workspace] members = ["proc_test", "hello_macro"] hello_macro hello_macro 是我们的测试包，即我们的 trait 和 main 都在这个包里 [package]
name = "hello_macro"
version = "0.1.0"
edition = "2021" [lib]
name = "hello_macro"
crate-type = ["rlib", "staticlib"] [dependencies]
proc_test = { path = "../proc_test" } 在 hello_macro/src/lib.rs 里，我们仅需要定义 trait pub trait HelloMacro { fn hello_macro();
} proc_test 我们的宏定义在 proc_test 里 [package]
name = "proc_test"
version = "0.1.0"
edition = "2021" [lib]
name = "proc_test"
proc-macro = true [dependencies]
syn = "1.0.103"
quote = "1.0.21" 重点来了，每个包含过程宏的包必定是 proc-macro 类型的 crate 而 proc-macro 不允许导出除了过程宏以外的其他函数或宏，所以一般需要单独成包 在 proc_test/src/lib.rs 下就是我们主要的内容了 extern crate proc_macro; use crate::proc_macro::TokenStream;
use quote::quote;
use syn; #[proc_macro_derive(HelloMacro)]
pub fn hello_macro_derive(input: TokenStream) -> TokenStream { let ast = syn::parse(input).unwrap(); impl_hello_macro(&ast)
} fn impl_hello_macro(ast: &syn::DeriveInput) -> TokenStream { let name = &ast.ident; let gen = quote! { impl HelloMacro for #name { fn hello_macro() { println!("Hello, Macro! My name is {}", stringify!(#name)); } } }; gen.into()
} 首先使用 extern crate proc_macro; 将 proc_macro 引入 crate 层级，而后导入 syn 和 quote::quote! 我们这里写的是一个衍生宏，所以使用 #[proc_macro_derive(HelloMacro)] 标注，而括号里面就是我们要衍生的 trait 了 一开始，我们使用 syn::parse 将传入的内容，一般就是需要衍生的 struct 或者 enum 的代码，解析为 AST 形式 [6] 而后将解析好的内容传给 impl_hello_macro 在 impl_hello_macro 里，我们从 AST 中获取到标识符的名称 ident，在 quote! 里我们实现了 hello_macro() 最后将实现的内容返回，这就完成了衍生过程 结果 我们将测试代码放在 hello_macro 包下，在 hello_macro/src/main.rs 里，就是我们要做到的效果了 use hello_macro::HelloMacro;
use proc_test::HelloMacro; #[derive(HelloMacro)]
struct Pank; fn main() { Pank::hello_macro();
} 我们在工作空间目录下使用 cargo run -p hello_macro 即可看到效果 Hello, Macro! My name is Pank 可以看到，我们使用 hello_macro 成功输入了 stuct 的名称 Pank

