} 处理好后, 我们在 localhost:3000 就可以看见这个页面 网页页面展示 可以看见, 我们这个 main 函数有点不一样 通常的 main 函数就是直接一个 fn main() { ... }, 而这个却是 async fn main() -> std::io::Result<()> { ... } 这个返回值类型 std::io::Result 还是可以理解的, 就是一个枚举类, 没问题就返回值本身, 有错误就返回错误, 而这里的 <()> 则是泛型的写法, 表示这个返回值是一个 io 操作的 Result 而且这个 main 函数上还有个 #[actix_web::main], 这个是一种 宏 (macro) , 对应的是 属性宏 (Attribute-like macros) , 这个宏使得我们的 main 函数可以是 async 的 main 函数里第一句 let 声明了一个不可变的变量, 他是 HttpServer 类型的, 就相当于我们用于处理响应的服务器了 HttpServer::new() 一句使用 new 这一个函数返回了一个 HttpServer 类型的对象(?不知这个说法对不对)， 这里的 new() 算是约定, 并不像其他语言的 new 关键字, 是规定好的, 你可以选择其他名字如 init() 来实现这个功能 new() 里面传递了一个 闭包 (Closure) 作为参数 闭包的基本格式是 | ... | { ...
} || 里表示被捕获的变量, 后面的 {} 里表示相关操作 这里我们没有捕获任何变量, 直接执行 {} 里的内容, 即使用 App::new() 来生成一个 actix_web::App 类型的对象， 使用 App 里的 route 函数配置路由 这个函数的类型是 pub fn route(self, path: &str, route: Route) -> Self 可见需要我们传递两个参数, 第一个参数是一个字符串引用, 即对应路径, 第二个参数就是 route, 即需要配置的路由 这里我们要把一个路由配置到网站根目录 (/), 而路由是由 get_index 函数配合 web::get().to() 得到 之后是一段提示性质的输出, 下面, 我们使用创建好的这个 HttpServer 使用 bind() 函数来说明要绑定的 套接字 (socket) 地址， 后面的 ? 这个符号表示 Error propagation 即将 bind 返回得到的错误传递给调用的函数, 而不是在当前位置就处理， 算是一种偷懒的方式, 这也是我们返回的 Result<()> 绑定好地址后就可以启动服务器了, run() 函数启动服务器, 返回一个 Server 类型的值， 而 .await 说明这个 Server 是以 await 的方式执行的

