} 这里就是从表单中得到 GcdParameters 类型, 返回一个响应, 先对输入进行检查, 如果输入含有 0 则显示 Computing the GCD with zero is boring! 这句话, 否则就计算 gcd 并返回 而计算 gcd 的方法就是常用的辗转相除法 fn gcd(mut m: u64, mut n: u64) -> u64 { assert!(m != 0 && n != 0); while m != 0 { if m < n { let t = m; m = n; n = t; } m = m % n; } n
} 之后, 我们还需要修改路由的配置, 将对 /gcd 的响应配置好, 将原来的 server 定义修改为: let server = HttpServer::new(|| { App::new() .route("/", web::get().to(get_index)) .route("/gcd", web::post().to(post_gcd))
