use std::io::ErrorKind; fn main() { let f = File::open("hello.txt").unwrap_or_else(|err| { if err.kind() == ErrorKind::NotFound { File::create("hello.txt").unwrap_or_else(|error| { panic!("Error creating file: {:#?}", error); }) } else { panic!("Error opening the file: {:#?}", err); } }); println!("{:#?}", f);
} 不过具体使用哪种风格是取决于你的习惯 处理 Result<T, E> 还有 unwrap() 和 expect() 两个方法 第一个方法默认会成功, 第二个是可以自定义错误信息, 成功都会返回正确内容 传播错误 传播错误, 也就是返回 Option<T> 或者 Result<T, E> 类型, 来让调用者知道和处理错误 在 Rust 里, 还可以使用 ? 操作符来实现 fn read_file_by_name(name: &str) -> Result<String, std::io::Error> { let mut f = File::open(name)?; // if error, return Err let mut s = String::new(); f.read_to_string(&mut s)?; // same Ok(s)
} 但是这里需要注意匹配错误类型, 如果错误类型不匹配, Rust 会调用相应错误下的 from() 函数来转化 Trait std::convert::From 的 from() 函数 由于 ? 会返回正确执行时的值, 所以我们还可以进一步简化 fn read_file_by_name(name: &str) -> Result<String, std::io::Error> { let mut s = String::new(); File::open(name)?.read_to_string(&mut s)?; Ok(s)
} 但是注意 ? 只能作用于返回值为 Option 或 Result 类型的函数, 或者实现了 Trait Try 的类型, 因为 ? 会调用 from_error 函数 Box<dyn Error> 表示所有可能的错误类型

