let guess: u32 = match guess.trim().parse() { Ok(num) => num, Err(_) => continue,
}; 这一句里有两个点要注意，一个是变量之间的shadow，另一个就是match语句 这里可以看到，我们又一次地声明了guess变量，在其他静态语言里，这是不允许的，而Rust可以做到，这是因为Rust中的shadow机制 简单来说就是，如果重复声明了一个变量，那么新的变量将会把旧的变量隐藏起来，无法使用，之后出现这个变量名都会指向新的这个变量 这个机制在进行变量类型转换 (cast) 的时候是十分有用的，就比如这里，我们通过parse()方法将guess由字符串解析为整形 [3] parse()函数的返回值也是一个 Result 类型，在这里，我们需要对这个枚举类型进行选择，即使用match语句 match语句的基本格式是 match <var> { arm1 => doSome1(), arm2 => doSome2(), ...
} 前面是要 匹配 的 模板 ，而=>指向的就是如果模板与我们的变量匹配成功后要进行的操作，这样的一个 模式匹配 的功能还是很强大的，之后的章节会详细讲到 这里我们对Result类型进行匹配，我们之前说过，Result类型是一个枚举类型，枚举对象有Ok，Err，所以这里我们使用这两个对象来进行匹配，如果解析成功的话，也就是Ok，那么，我们就将解析到的值保存到一个叫 num 的变量里，之后返回出来，如果失败，那么这次循环就直接continue跳过了，进行下次循环，再次要求用户输入，直到解析成功，我们才会进行下一步操作

